import "./App.css";
import ClassCard from "./components/ClassCard";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/card">
          <ClassCard component={ClassCard} />
        </Route>
      </div>
    </Router>
  );
}

export default App;
